-start=\\\"2161\\\" data-end=\\\"2202\\\" class=\\\"\\\">\n<p data-start=\\\"2163\\\" data-end=\\\"2202\\\" class=\\\"\\\">Pets are not allowed inside lake area<\/p>\n<\/li>\n<li data-start=\\\"2203\\\" data-end=\\\"2255\\\" class=\\\"\\\">\n<p data-start=\\\"2205\\\" data-end=\\\"2255\\\" class=\\\"\\\">Littering or feeding fish\/ducks is not permitted<\/p>\n<\/li>\n<li data-start=\\\"2256\\\" data-end=\\\"2303\\\" class=\\\"\\\">\n<p data-start=\\\"2258\\\" data-end=\\\"2303\\\" class=\\\"\\\">Adhere to safety instructions by lake staff<\/p>\n<\/li>\n<li data-start=\\\"2304\\\" data-end=\\\"2354\\\" class=\\\"\\\">\n<p data-start=\\\"2306\\\" data-end=\\\"2354\\\" class=\\\"\\\">Loud music or shouting inside boat not allowed<\/p>\n<\/li>\n<li data-start=\\\"2355\\\" data-end=\\\"2411\\\" class=\\\"\\\">\n<p data-start=\\\"2357\\\" data-end=\\\"2411\\\" class=\\\"\\\">Avoid boating during heavy rains or foggy conditions<\/p><\/li>","useful_info":"<li data-start=\\\"2445\\\" data-end=\\\"2499\\\" class=\\\"\\\"><p data-start=\\\"2447\\\" data-end=\\\"2499\\\" class=\\\"\\\">Best visited during early morning or evening hours<\/p>\n<\/li>\n<li data-start=\\\"2500\\\" data-end=\\\"2560\\\" class=\\\"\\\">\n<p data-start=\\\"2502\\\" data-end=\\\"2560\\\" class=\\\"\\\">Nearby attractions: Ropeway, Artist Village, Lake Garden<\/p>\n<\/li>\n<li data-start=\\\"2561\\\" data-end=\\\"2629\\\" class=\\\"\\\">\n<p data-start=\\\"2563\\\" data-end=\\\"2629\\\" class=\\\"\\\">Multiple boat sizes available \u2013 2-seater, 4-seater, and 6-seater<\/p>\n<\/li>\n<li data-start=\\\"2630\\\" data-end=\\\"2681\\\" class=\\\"\\\">\n<p data-start=\\\"2632\\\" data-end=\\\"2681\\\" class=\\\"\\\">Vendors nearby sell corn, snacks, and souvenirs<\/p>\n<\/li>\n<li data-start=\\\"2682\\\" data-end=\\\"2752\\\" class=\\\"\\\">\n<p data-start=\\\"2684\\\" data-end=\\\"2752\\\" class=\\\"\\\">Horse and camel rides available along the lakefront (extra charge)<\/p>\n<\/li>\n<li data-start=\\\"2753\\\" data-end=\\\"2797\\\" class=\\\"\\\">\n<p data-start=\\\"2755\\\" data-end=\\\"2797\\\" class=\\\"\\\">Weather is generally pleasant year-round<\/p>\n<\/li>\n<li data-start=\\\"2798\\\" data-end=\\\"2854\\\" class=\\\"\\\">\n<p data-start=\\\"2800\\\" data-end=\\\"2854\\\" class=\\\"\\\">Clean and well-maintained public washroom facilities<\/p>\n<\/li>\n<li data-start=\\\"2855\\\" data-end=\\\"2904\\\" class=\\\"\\\">\n<p data-start=\\\"2857\\\" data-end=\\\"2904\\\" class=\\\"\\\">Small shops offer tribal handicrafts and toys<\/p>\n<\/li>\n<li data-start=\\\"2905\\\" data-end=\\\"2944\\\" class=\\\"\\\">\n<p data-start=\\\"2907\\\" data-end=\\\"2944\\\" class=\\\"\\\">Mobile network is good in this area<\/p><\/li>","booking_policy":"<li data-start=\\\"2445\\\" data-end=\\\"2499\\\" class=\\\"\\\"><li data-start=\\\"2974\\\" data-end=\\\"3025\\\" class=\\\"\\\"><p data-start=\\\"2976\\\" data-end=\\\"3025\\\" class=\\\"\\\">Tickets available on the spot at ticket counter<\/p>\n<\/li><li data-start=\\\"3026\\\" data-end=\\\"3079\\\" class=\\\"\\\">\n<p data-start=\\\"3028\\\" data-end=\\\"3079\\\" class=\\\"\\\">No online booking required for regular boat rides<\/p>\n<\/li><li data-start=\\\"3080\\\" data-end=\\\"3140\\\" class=\\\"\\\">\n<p data-start=\\\"3082\\\" data-end=\\\"3140\\\" class=\\\"\\\">Group bookings can be made in advance via tourism office<\/p>\n<\/li><li data-start=\\\"3141\\\" data-end=\\\"3184\\\" class=\\\"\\\">\n<p data-start=\\\"3143\\\" data-end=\\\"3184\\\" class=\\\"\\\">ID proof may be needed for boat rentals<\/p>\n<\/li><li data-start=\\\"3185\\\" data-end=\\\"3250\\\" class=\\\"\\\">\n<p data-start=\\\"3187\\\" data-end=\\\"3250\\\" class=\\\"\\\">Discounted tickets available for students and senior citizens<\/p>\n<\/li><li data-start=\\\"3251\\\" data-end=\\\"3309\\\" class=\\\"\\\">\n<p data-start=\\\"3253\\\" data-end=\\\"3309\\\" class=\\\"\\\">Group packages can include boating + lake garden entry<\/p>\n<\/li><li data-start=\\\"3310\\\" data-end=\\\"3349\\\" class=\\\"\\\">\n<p data-start=\\\"3312\\\" data-end=\\\"3349\\\" class=\\\"\\\">No rescheduling allowed after entry<\/p>\n<\/li><li data-start=\\\"3350\\\" data-end=\\\"3403\\\" class=\\\"\\\">\n<p data-start=\\\"3352\\\" data-end=\\\"3403\\\" class=\\\"\\\">Separate counters for paddle vs. row boat booking<\/p>\n<\/li><p data-start=\\\"2447\\\" data-end=\\\"2499\\\" class=\\\"\\\">\n\n\n\n\n\n\n\n<\/p><li data-start=\\\"3404\\\" data-end=\\\"3455\\\" class=\\\"\\\">\n<p data-start=\\\"3406\\\" data-end=\\\"3455\\\" class=\\\"\\\">Weekends may involve wait time of 15\u201330 minutes<\/p><\/li><\/li>","canc_policy":"<li data-start=\\\"3490\\\" data-end=\\\"3525\\\" class=\\\"\\\"><p data-start=\\\"3492\\\" data-end=\\\"3525\\\" class=\\\"\\\">No refund once ticket is issued<\/p>\n<\/li>\n<li data-start=\\\"3526\\\" data-end=\\\"3585\\\" class=\\\"\\\">\n<p data-start=\\\"3528\\\" data-end=\\\"3585\\\" class=\\\"\\\">Ride can be cancelled by authorities due to bad weather<\/p>\n<\/li>\n<li data-start=\\\"3586\\\" data-end=\\\"3647\\\" class=\\\"\\\">\n<p data-start=\\\"3588\\\" data-end=\\\"3647\\\" class=\\\"\\\">In case of cancellation by operator, full refund provided<\/p>\n<\/li>\n<li data-start=\\\"3648\\\" data-end=\\\"3696\\\" class=\\\"\\\">\n<p data-start=\\\"3650\\\" data-end=\\\"3696\\\" class=\\\"\\\">Refunds processed at the ticket counter only<\/p>\n<\/li>\n<li data-start=\\\"3697\\\" data-end=\\\"3737\\\" class=\\\"\\\">\n<p data-start=\\\"3699\\\" data-end=\\\"3737\\\" class=\\\"\\\">No-show is considered as used ticket<\/p>\n<\/li>\n<li data-start=\\\"3738\\\" data-end=\\\"3800\\\" class=\\\"\\\">\n<p data-start=\\\"3740\\\" data-end=\\\"3800\\\" class=\\\"\\\">Group bookings can be cancelled 24 hours before for refund<\/p>\n<\/li>\n<li data-start=\\\"3801\\\" data-end=\\\"3857\\\" class=\\\"\\\">\n<p data-start=\\\"3803\\\" data-end=\\\"3857\\\" class=\\\"\\\">Refund not applicable if guest discontinues mid-ride<\/p>\n<\/li>\n<li data-start=\\\"3858\\\" data-end=\\\"3906\\\" class=\\\"\\\">\n<p data-start=\\\"3860\\\" data-end=\\\"3906\\\" class=\\\"\\\">Tickets non-transferable to other activities<\/p>\n<\/li>\n<li data-start=\\\"3907\\\" data-end=\\\"3963\\\" class=\\\"\\\">\n<p data-start=\\\"3909\\\" data-end=\\\"3963\\\" class=\\\"\\\">Operator holds final decision rights in all disputes<\/p><\/li>","images_array":"[{\"image_url\":\"..\\\/..\\\/uploads\\\/\\\/b2b_activity\\\/\\\/2025\\\/\\\/Apr\\\/\\\/08\\\/\\\/1744082786\\\/saputaralake.jpg\"}]","costing_array":"[{\"transfer_option\":\"Without Transfer\",\"from_date\":\"2025-04-08\",\"to_date\":\"2025-05-31\",\"adult_cost\":100,\"child_cost\":100,\"infant_cost\":0}]"},{"activity_id":"21","activity_name":"Statue Of Unity ","city_name":"Gujrat","city_id":"6112","duration":"4 to 6 Hours","pickup_point":"Main Gate Entry","rep_time":"08:00 AM","description":"Visit the world\u2019s tallest statue \u2014 the Statue of Unity, a tribute to Sardar Vallabhbhai Patel, rising 182 meters above the Narmada River.\nThis massive structure is a marvel of architecture, engineering, and Indian pride.\nBuilt to honor India\u2019s Iron Man, it is located amidst scenic hills and a river backdrop.\nThe observation deck offers panoramic views from 153 meters high.\nThe entire complex is surrounded by gardens, themed zones, and attractions.\nIt is a great destination for families, students, and history enthusiasts.\nThe evening light and sound show narrates the inspiring story of Patel.\nIt is also a sustainable and green tourism spot with integrated ticket options.\nInternal transport is provided by regular shuttle buses and e-rickshaws.\n\n","off_days":"Tuesday","note":"Don\u2019t miss the evening projection mapping show at the statue base.\nBook your tickets online in advance, especially during weekends and holidays, to avoid long queues or unavailability.","currency":"INR","inclusions":"<p data-start=\\\"1278\\\" data-end=\\\"1364\\\" class=\\\"\\\"><ul><li>Entry to Statue of Unity complex, museum, exhibition hall, and audio-visual gallery.<\/li><li>Lift access to the viewing gallery for ticket holders.<\/li><li>Access to Valley of Flowers, riverfront, and dam viewpoints.<\/li><li>Combo ticket includes Jungle Safari, Cactus Garden, Ekta Nursery, and Arogya Van.<\/li><li>Shuttle bus transport within the complex.<\/li><li>Medical and restroom facilities included.<\/li><li>Access to the laser show zone (as per ticket).<\/li><li>Informational signage and audio support in key zones.<\/li><li>Public seating and shaded rest areas.<\/li><\/ul><\/p>\n\n\n\n\n\n\n\n","exclusions":"<p data-start=\\\"1836\\\" data-end=\\\"1881\\\" class=\\\"\\\"><ul><li>Travel to and from Kevadia is not included.<\/li><li>Meals or refreshments are at personal cost.<\/li><li>Boating, drone or DSLR usage, and adventure activities are charged separately.<\/li><li>Guided tours and shopping at Ekta Mall are not part of the basic ticket.<\/li><li>Accommodation at Tent City is not included in the entry ticket.<\/li><li>Express entry or premium services need separate booking.<\/li><li>Parking charges are additional.<\/li><li>Entry to children\u2019s play area and water zone requires separate passes.<\/li><li>Locker or baggage storage not included.<\/li><\/ul><\/p>\n\n\n\n\n\n\n\n","terms_condition":"<p data-start=\\\"2400\\\" data-end=\\\"2460\\\" class=\\\"\\\"><ul><li>The site is open every day except Mondays for maintenance.<\/li><li>Visitors must carry valid ID proof.<\/li><li>Follow safety and queue regulations, especially at the lift and gallery areas.<\/li><li>Children below 3 years enter free.<\/li><li>Pets are not allowed.<\/li><li>Littering and smoking are strictly prohibited.<\/li><li>Entry times must be respected.<\/li><li>Tickets cannot be reused once scanned.<\/li><li>Maintenance schedules may affect access to certain zones.<\/li><\/ul><\/p>\n\n\n\n\n\n\n\n","useful_info":"<p data-start=\\\"2866\\\" data-end=\\\"2938\\\" class=\\\"\\\"><ul><li>The best time to visit is between October and March for clear weather.<\/li><li>The site is about 200 km from Ahmedabad.<\/li><li>Battery-operated vehicles and shuttle buses are available inside the complex.<\/li><li>The observation deck has limited capacity, so arrive early.<\/li><li>Public water stations are available.<\/li><li>Comfortable footwear and sunscreen are recommended.<\/li><li>The entire complex is wheelchair accessible.<\/li><li>Mobile signal is generally strong.<\/li><li>Avoid peak hours to enjoy a more relaxed experience.<\/li><\/ul><\/p>\n\n\n\n\n\n\n\n","booking_policy":"<p data-start=\\\"3394\\\" data-end=\\\"3463\\\" class=\\\"\\\"><ul><li>Online booking is available on the official site <a data-start=\\\"3443\\\" data-end=\\\"3460\\\" rel=\\\"noopener\\\" target=\\\"_new\\\" class=\\\"\\\" href=\\\"http:\/\/www.soutickets.in\\\">www.soutickets.in<\/a>.<\/li><li>Combo tickets give better value.<\/li><li>School and college groups are welcome with prior bookings.<\/li><li>QR-coded tickets ensure faster entry.<\/li><li>Walk-in tickets may be limited during weekends.<\/li><li>Children below 15 must be accompanied by an adult.<\/li><li>Tickets can be rescheduled once online.<\/li><li>Express entry requires a premium pass.<\/li><li>Tent City stays must be booked separately.<\/li><\/ul><\/p>\n\n\n\n\n\n\n\n","canc_policy":"<p data-start=\\\"3874\\\" data-end=\\\"3951\\\" class=\\\"\\\"><ul><li>Cancellations are accepted up to 24 hours before visit for online bookings.<\/li><li>No refund is provided for same-day cancellations or no-shows.<\/li><li>Full refund is issued if the park is closed by authorities.<\/li><li>Group bookings are non-refundable within 24 hours.<\/li><li>Refunds are processed within 5\u20137 business days.<\/li><li>Used or partially used tickets are non-refundable.<\/li><li>Payment gateway charges are not refunded.<\/li><li>Tickets bought at the counter are not eligible for refund.<\/li><li>Tickets are non-transferab