y carrier - included in the application pack<\/div><div>2. Hold a round-trip, non-refundable and non-transferable ticket<\/div><div>3. Complete and signed the Form I-736 Guam Visa Waiver information provided by the airline<\/div><div>4. Not travelling owards to another destination in the United States<\/div><div>5. Not apply for an extension of stay, adjustment of status or change of non-immigrant status<\/div><div>6. Hold a passport valid at least six months on entry with two blank visa pages<\/div><div>7. Hold proof of sufficient funds<\/div>"},{"entry_id":"89","country":"Guatemala","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Bank statement<br>2. Air ticket<br>3. Passport"},{"entry_id":"90","country":"Guinea","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Bank statement<div><br><\/div>"},{"entry_id":"91","country":"Guinea-bissau","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket"},{"entry_id":"92","country":"Guyana","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Medical reports<br>6. Police clearance certificate PCC<br><div><br><\/div>"},{"entry_id":"93","country":"Haiti","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Govt id card"},{"entry_id":"94","country":"Heard Island And Mcdonald Islands","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Visa Application Form: Complete application form online for Heard Island and McDonald Islands<\/div><div>2. Passport Photo: Photo must be no older than 6 months<\/div><div>3. Passport Copy: A clear scan of the information pages of your signed, machine readable passport.&nbsp;<\/div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Provide the pages of your current passport showing your photo, personal details and passport issue and expiry dates.&nbsp;<\/div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Must be valid for six months beyond the expiry date of the visa.<\/div><div>4. National Identity: Provide a certified copy of your national identity card\/s (other than your passport).&nbsp;<\/div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; You must provide a copy of both sides of each card.<\/div><div>5. Invitation Letter: A letter from your relative or friend or company inviting you to visit and their relationship to you.&nbsp;<\/div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The letter could state: the purpose of your visit and length of stay, if you will be staying with them, If this person will be paying for your stay, provide proof of their funds.<\/div><div>6. Previous Visa: Previous visas if available<\/div><div>7. Proof of Funds: Proof you have enough money for your stay and to leave, such as<\/div><div>\u00e2\u20ac\u00a2 personal bank statements<\/div><div>\u00e2\u20ac\u00a2 Pay slips from employer<\/div><div>\u00e2\u20ac\u00a2 Proof of accomodation<\/div><div>\u00e2\u20ac\u00a2 Audited accounts,<\/div><div>\u00e2\u20ac\u00a2 Tax records<\/div><div>\u00e2\u20ac\u00a2 Credit card limit.<\/div><div>8. Proof of Return: Proof that you have reasons to return home such as:<\/div><div>\u00e2\u20ac\u00a2 A letter from your employer stating you plan to return to your job<\/div><div>\u00e2\u20ac\u00a2 Proof that you study at a school, college or university in your home country<\/div><div>\u00e2\u20ac\u00a2 Proof that you have immediate family members in your home country(photos, marriage certificates etc)<\/div><div>\u00e2\u20ac\u00a2 Proof that you can return home<\/div><div>\u00e2\u20ac\u00a2 Proof that you own a house or other major assets in your home country<\/div><div>9. Travel itinerary: Travel itinerary (travel reservation to and from the country\/area in your name, not a ticket)<\/div>"},{"entry_id":"95","country":"Holy See (vatican City State)","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page<\/div><div>2. Hold proof of onward and return flights<\/div><div>3. Hold all documents required for the next destination<\/div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)<\/div><div>5. Hold proof of sufficient funds relative to your intended length of stay<\/div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa<\/div>"},{"entry_id":"96","country":"Honduras","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any<\/div><div>2. 2 Scanned recent colour photograph. (Photo Specification);<\/div><div>3. Visa Application forms: completed and signed<\/div><div>4. Personal Covering letter: explaining purpose of travel to the country<\/div><div>5. Original Bank Statement: stamped &amp; updated for last 3 months with bank seal<\/div><div>6. Air tickets: proof of return flight tickets from and back to your home country<\/div><div>7. Hotel reservation: proof of accommodation for your entire stay<\/div><div>8. Travel I