ation, or proof of sufficient means to cover his\/her accommodation;<\/div><div>6. documents indicating that the applicant possesses sufficient means of subsistence both for the duration of the intended stay and for the return to his country of origin or residence, or for the transit to a third country into which he is certain to be admitted, or that he is in a position to acquire such means lawfully;<\/div><div>7. Information enabling an assessment of the applicant\u00e2\u20ac\u2122s intention to leave the territory of the Republic of Kosovo before the expiry of the visa applied for.<\/div><div>8. Travel medical insurance valid throughout the territory of the Republic of Kosovo which covers the entire period of the person\u00e2\u20ac\u2122s intended stay or transit.<\/div><div>9. The visa fee payment of 40 EUR that applicants need to pay unless they are holders of diplomatic and official passports; children nder six (6) years old; or school children, students and teachers accompanying and visiting for studying or training purposes.<\/div>"},{"entry_id":"115","country":"Kuwait","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket<br>4. Pan card"},{"entry_id":"116","country":"Kyrgyzstan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<br>6. Covering letter from applicant<br>7. Hotel vocuher&nbsp;"},{"entry_id":"117","country":"Lao Peoples Democratic Republic","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket"},{"entry_id":"118","country":"Latvia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","do