s made 3 to 6 days before the travel date will incur a 60% cancellation fee<\/li><li>No refunds will be provided for cancellations made within 48 hours of departure or for no-shows<\/li><li>Cancellation requests must be submitted in writing via email or through the booking portal<\/li><li>Any refunds, if applicable, will be processed after deducting bank transaction charges<\/li><li>Group bookings may have different cancellation terms based on contract<\/li><li>Refund eligibility may vary depending on promotional or discounted offers<\/li><li>In case of rescheduling, cancellation charges may still apply<\/li><li>Cancellation terms are subject to change and will be updated on our website<\/li><\/ul><\/div>","refund_policy":"<div><ul><li>Refunds are initiated only after receiving a valid cancellation request<\/li><li>Processing time for refunds is typically 7\u201310 business days<\/li><li>Refunds will be made to the original payment method used at the time of booking<\/li><li>No cash refunds will be issued for online payments<\/li><li>In case of delays due to third-party service providers, refund timelines may vary<\/li><li>Partial refunds will be applicable in case of partial service utilization<\/li><li>Force majeure events (natural disasters, pandemics, etc.) are subject to special refund rules<\/li><li>Administrative fees and service charges are non-refundable<\/li><li>Refunds will not be applicable for activities marked as \"non-refundable\"<\/li><li>Refund requests made after the travel date will not be accepted<\/li><li>Any refund disputes must be raised within 15 days of the booking date<\/li><\/ul><\/div>","privacy_policy":"<div><ul><li>We collect personal information only for the purpose of processing bookings<\/li><li>All customer data is encrypted and stored securely<\/li><li>We do not sell, trade, or rent customer data to third parties<\/li><li>Data sharing occurs only with service providers for fulfilling the booking<\/li><li>Payment details are handled